/**
 * Inter Font Loader for jsPDF
 *
 * This file contains the Inter font family embedded as base64 strings.
 * - Inter Regular: Used for normal text
 * - Inter Medium: Used for bold text (less heavy than Inter Bold)
 *
 * Generated automatically - do not edit manually
 */

// Inter Regular font (base64 encoded)
const INTER_REGULAR_BASE64 = "";

// Inter Medium font (base64 encoded) - used for bold text
const INTER_MEDIUM_BASE64 = "";

/**
 * Load Inter fonts into jsPDF document
 * @param {jsPDF} doc - The jsPDF document instance
 * @returns {boolean} - True if fonts loaded successfully
 */
function loadInterFonts(doc) {
    try {
        if (INTER_REGULAR_BASE64 && INTER_MEDIUM_BASE64) {
            // Add Inter Regular
            doc.addFileToVFS('Inter-Regular.ttf', INTER_REGULAR_BASE64);
            doc.addFont('Inter-Regular.ttf', 'Inter', 'normal');

            // Add Inter Medium for bold
            doc.addFileToVFS('Inter-Medium.ttf', INTER_MEDIUM_BASE64);
            doc.addFont('Inter-Medium.ttf', 'Inter', 'bold');

            doc.setFont('Inter', 'normal');

            console.log('Inter fonts loaded successfully (Regular and Medium)');
            return true;
        } else {
            console.warn('Inter font base64 strings not provided, using fallback fonts');
            return false;
        }
    } catch (error) {
        console.error('Failed to load Inter fonts:', error);
        return false;
    }
}

// Export for use in other modules
if (typeof module !== 'undefined' && module.exports) {
    module.exports = { loadInterFonts, INTER_REGULAR_BASE64, INTER_MEDIUM_BASE64 };
}

// Also expose to window for browser usage
if (typeof window !== 'undefined') {
    window.loadInterFonts = loadInterFonts;
}
